import FaShoppingCart from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <nav>
      <div className="flex flex-row justify-between">
          <NavLink to="/"></NavLink>
          <div>
            <p>Home</p>
            <FaShoppingCart/>
          </div>
      </div>
    </nav>
  );
};

export default Navbar;
